- Cách đúng 1 nhà ra trục chính liên thôn;
- Đất nằm trục chính ngõ trải nhựa, oto 9c chạy vèo vèo;
- Ngay sát Vin Gia Lâm, ngay tẹo tới chợ Bún Đa Tốn
